var panel={init:function(){$("#communityId").val(common.getQueryString("communityId"));$("#id").val(common.getQueryString("id"));this.goodActivetyType()},goodActivetyType:function(){$.ajax({type:"POST",url:urlScope+"/CommunityDetail/findDiscountInformation",dataType:"json",data:{communityId:$("#communityId").val(),id:$("#id").val()},success:function(b){b=b.object;if(b.endDiscountTime!=null){var a="";a+='<tr class="text-c"><td>'+common.dateFormat(b.startDiscountTime.time)+"</td><td >"+common.dateFormat(b.endDiscountTime.time)+"</td><td >"+b.discountInformation+"</td></tr>";$("tbody").html(a)}},error:function(a){layer.msg("网络错误",{icon:1,time:1000})}})}};$(function(){panel.init()});